import React from "react";

const GoalDetail = props => {
  return (
    <div>
      <p>Detail for: {goal.title}</p>
      <p>{goal.description}</p>
      <p>{goal.hours}</p>
      <p>{goal.totalTime}</p>
      <p>{goal.goalCompleted}</p>
    </div>
  );
};

export default GoalDetail;
